INSERT INTO `edu_major` VALUES (1, '软件工程', '软件工程是一门研究用工程化方法构建和维护有效的、实用的和高质量的软件的学科。它涉及程序设计语言、数据库、软件开发工具、系统平台、标准、设计模式等方面。\r\n在现代社会中，软件应用于多个方面。\r\n         2.典型的软件有电子邮件、嵌入式系统、人机界面、办公套件、操作系统、编译器、数据库、游戏等。同时，各个行业几乎都有计算机软件的应用，如工业、农业、银行、航空、政府部门等。这些应用促进了经济和社会的发展，也提高了工作效率和生活效率 。', 'admin', '2022-09-14 15:02:06', 'admin', '2020-11-08 16:40:48', '0');
INSERT INTO `edu_major` VALUES (2, '平面设计', '平面设计（graphic design），也称为视觉传达设计，是以“视觉”作为沟通和表现的方式，透过多种方式来创造和结合符号、图片和文字，借此作出用来传达想法或讯息的视觉表现。平面设计师可能会利用字体排印、视觉艺术、版面（page layout）、电脑软件等方面的专业技巧，来达成创作计划的目的。平面设计通常可指制作（设计）时的过程，以及最后完成的作品。\r\n平面设计的常见用途包括标识（商标和品牌）、出版物（杂志，报纸和书籍）、平面广告，海报，广告牌，网站图形元素、标志和产品包装。例如，产品包装可能包括的商标或其他的艺术作品、编排文本和纯粹的设计元素，如风格统一的图像，形状，大小和颜色。组合是平面设计的最重要的特性之一，尤其是当产品使用预先存在的材料或多种元素融合。', 'admin', '2022-09-01 15:04:48', NULL, NULL, '0');
INSERT INTO `edu_major` VALUES (3, '动画设计', '动画是通过连续播放一系列画面，给视觉造成连续变化的图画。它的基本原理与电影、电视一样,都\r\n动画人物\r\n动画人物\r\n是视觉原理。医学已证明，人类具有“视觉暂留”的特性，就是说人的眼睛看到一幅画或一个物体后，在1/24秒内不会消失。利用这一原理，在一幅画还没有消失前播放出下一幅画，就会给人造成一种流畅的视觉变化效果。因此，电影采用了每秒24幅画面的速度拍摄播放，电视采用了每秒25幅（PAL制）(中央电视台的动画就是PAL制)或30幅（NSTC制）画面的速度拍摄播放。如果以每秒低于24幅画面的速度拍摄播放，就会出现停顿现象。', 'admin', '2020-12-25 15:06:08', NULL, NULL, '0');
INSERT INTO `edu_major` VALUES (5, 'java', 'Java是一门面向对象编程语言，不仅吸收了C++语言的各种优点，还摒弃了C++里难以理解的多继承、指针等概念，因此Java语言具有功能强大和简单易用两个特征。Java语言作为静态面向对象编程语言的代表，极好地实现了面向对象理论，允许程序员以优雅的思维方式进行复杂的编程 [1]  。\r\nJava具有简单性、面向对象、分布式、健壮性、安全性、平台独立与可移植性、多线程、动态性等特点 [2]  。Java可以编写桌面应用程序、Web应用程序、分布式系统和嵌入式系统应用程序等 [3]  。', 'admin', '2022-07-12 16:06:21', 'admin', '2020-06-03 15:40:15', '0');
